import React, {Component} from 'react'

class BaseComponent extends Component{
    render(){
        return(
            <div>
                <div style={'width=30%'}>
                    dsfsdfsd
                </div>
                <div style={'width=70%'}>
                    Second component
                </div>
            </div>
        )
    }
}
export default BaseComponent
